// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import Home from './Home';
import Register from './Register';

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/src/Components/TrangChu.js">Trang chủ</Link>
          </li>
          <li>
            <Link to="/src/Components/DangKy.js">Đăng ký</Link>
          </li>
        </ul>
      </nav>
      <Switch>
        <Route exact path="/src/Components/TrangChu.js" component={Home} />
        <Route path="/src/Components/DangKy.js" component={Register} />
      </Switch>
    </Router>
  );
}

export default App;
